describe('Switch weblayout when track change revision added in endnote widget', () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        document.body.innerHTML = '';
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableEditorHistory: true, enableLocalPaste: false });
        DocumentEditor.Inject(Editor, Selection, EditorHistory);
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(() => {
            done();
        }, 1000);
    });
    it('Switch the layout', () => {
        console.log('Switch the layout');
        editor.open(sfdt1);
        editor.selectionModule.select('0;EN;10;1;0;149', '0;EN;10;1;0;149');
        editor.editorModule.onEnter();
        editor.enableTrackChanges = true;
        editor.editorModule.insertText('Syncfusion');
        let length: number = editor.documentHelper.pages[editor.documentHelper.pages.length - 1].endnoteWidget.bodyWidgets.length;
        editor.layoutType = 'Continuous';
        editor.layoutType = 'Pages';
        expect(() => { editor.documentHelper.layout.layoutWholeDocument() }).not.toThrowError();
        expect(editor.documentHelper.pages[editor.documentHelper.pages.length - 1].endnoteWidget.bodyWidgets.length).toBe(length);
    });
});
describe('Double tap on the foot note element', () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        document.body.innerHTML = '';
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableEditorHistory: true, enableLocalPaste: false });
        DocumentEditor.Inject(Editor, Selection, EditorHistory);
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(() => {
            done();
        }, 1000);
    });
    it('Select the foot note body widget', () => {
        console.log('Select the foot note body widget');
        editor.open(sfdt1);
        //Issue1
        editor.selectionModule.select('0;0;19', '0;0;19');
        let startPosition: TextPosition = editor.selection.start.clone();
        let endPosition: TextPosition = editor.selection.end.clone();
        let inlineObj: ElementInfo = startPosition.currentWidget.getInline(startPosition.offset, 0);
        let inline: ElementBox = inlineObj.element;
        (editor.viewer.documentHelper as any).navigateToEndNote(inline, startPosition, endPosition);
        expect((editor.selection.start.currentWidget.children[0] as FootnoteEndnoteMarkerElementBox).text).toBe('i');
        //Issue2
        editor.selectionModule.select('0;4;47', '0;4;47');
        startPosition = editor.selection.start.clone();
        endPosition = editor.selection.end.clone();
        inlineObj = startPosition.currentWidget.getInline(startPosition.offset, 0);
        inline = inlineObj.element;
        (editor.viewer.documentHelper as any).navigateToEndNote(inline, startPosition, endPosition);
        expect((editor.selection.start.currentWidget.children[0] as FootnoteEndnoteMarkerElementBox).text).toBe('ii');
    });
});
